  Patrick b. at Christchurch. Wendy, d/o Brian and Beverley Pattrick of Christchurch. Address: 69 Bishop
  Street, Christchurch.
  Patrick was educated at Cathedral Grammar School; Waihi School, Winchester and Christ's College. He
  trained as a chef at Christchurch Polytechnic then studied interior design for a year at the Sydney
  College of Arts. He has completed his New Zealand Certificate of Draughting and is now employed as a
  draughtsman at Stuart Ross Architects.
  Wendy graduated Bachelor of Fine Arts in 1988, majoring in Print Making and Art History then graduated
  DipTchng from the Christchurch College of Education in 1994. She is now an art teacher and artist.
  01> FITZGERALD, George Pattrick
