  03> FITZGERALD, Caroline Temple
  b 17.11.1964
  Caroline b. at Christchurch. She was educated at Selwyn House and St Margaret's College and studied
  art and design at Christchurch Polytechnic and at Heatherlea Art School in London. She became a
  self-employed artist and designer of wine and tourist maps. She trained as a journalist in 1986 and
  became involved with broadcasting and Sky TV. In 1996 she travelled extensively in Europe and
  completed a course with the English Language School in Hastings, On returning to New Zealand she
  worked with the Dominion English School in Christchurch. In 1997 she continued with teaching English
  as a second language in South Africa and is at present with the Linguarama School in Munich, Germany.
